import React from 'react';

function SearchResults (props) {
    console.log('array of results', props.results.length);

    const searchCount = props.results
    return (
        <div id="results">
            <h3>Here's what we found ({props.results.length}):</h3>
            <h3>Here's what we found ({searchCount.length}):</h3>
        </div>
    )
}

export default SearchResults
